import React from 'react';
import img1 from './images/AccountingLogo.png';
import img2 from './images/MathLogo.png';
import img3 from './images/ScienceLogo.png';
import './Menu.css';
import Nav from './Nav';
import styled from 'styled-components'; 

function Images(){

    const Container = styled.div`
        width: 100vw
        height: 80w;
        background-color: green;
    `

    const ImageBox = styled.div`
        width: 25vw;
        height: 25vw;
        background-repeat: no-repeat;
        background-position: center;
        background-size: cover;
    `

    return(
        <div>
            <Nav></Nav>
            <Container>
                <ImageBox style={{backgroundImage: {img1}}}>
                </ImageBox>

                <img style={{ width: 130, height: 117 }} src={img3} alt="Science Logo"/>
                <img style={{ width: 121, height: 117 }} src={img1} alt="Accounting Logo"/>
            </Container>
        </div>
    )
}


export default Images;
